import React, {Component} from 'react';

class Card extends Component {

    render () {
        return (
            <div className="container-fluid">
                <div className="card">
                    <img className="card-img-top" src="this.props.image" alt="Card image cap"/>


                </div>
            </div>
        )
    }
}

export default Card;
